// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract AuditTrail is AccessControl {
    bytes32 public constant LOGGER_ROLE = keccak256("LOGGER_ROLE");

    struct Record {
        address user;
        uint256 amount;
        uint256 timestamp;
    }

    event TransactionLogged(address indexed user, uint256 amount, uint256 timestamp);

    Record[] public records;

    constructor(address admin) {
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
    }

    function logTransaction(address user, uint256 amount) external onlyRole(LOGGER_ROLE) {
        records.push(Record(user, amount, block.timestamp));
        emit TransactionLogged(user, amount, block.timestamp);
    }
}

contracts/evm/NFTMarketplace.sol.content:
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract NFTMarketplace is ReentrancyGuard {

    IERC721 public immutable nftContract;
    uint256 public feePercentage = 5; // 5% fee
    address public feeRecipient;

    struct Listing {
        uint256 price;
        address seller;
    }

    mapping(uint256 => Listing) public listings;

    constructor(address _nftContract, address _feeRecipient) {
        nftContract = IERC721(_nftContract);
        feeRecipient = _feeRecipient;
    }

    function list(uint256 tokenId, uint256 price) external nonReentrant {
        require(nftContract.ownerOf(tokenId) == msg.sender, "Only owner can list");
        nftContract.transferFrom(msg.sender, address(this), tokenId);
        listings[tokenId] = Listing({price: price, seller: msg.sender});
    }

    function purchase(uint256 tokenId) external payable nonReentrant {
        Listing memory listing = listings[tokenId];
        require(listing.price > 0, "Not for sale");
        require(msg.value >= listing.price, "Insufficient amount");

        uint256 fee = (listing.price * feePercentage) / 100;
        uint256 sellerAmount = listing.price - fee;

        nftContract.transferFrom(address(this), msg.sender, tokenId);
        payable(listing.seller).transfer(sellerAmount);
        payable(feeRecipient).transfer(fee);

        delete listings[tokenId];
    }

    function cancelListing(uint256 tokenId) external nonReentrant {
        Listing memory listing = listings[tokenId];
        require(listing.seller == msg.sender, "Not seller");
        nftContract.transferFrom(address(this), msg.sender, tokenId);
        delete listings[tokenId];
    }
}

contracts/evm/NFTStaking.sol.content:
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/IERC721Enumerable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract NFTStaking is ReentrancyGuard {
    IERC721Enumerable public immutable nftContract;
    uint256 public rewardRate = 1 ether; // reward per second per NFT

    struct StakeInfo {
        uint256 tokenId;
        uint256 startTime;
    }

    mapping(address => StakeInfo[]) public stakes;
    mapping(uint256 => address) public tokenOwner;
    mapping(address => uint256) public rewards;

    constructor(address _nftContract) {
        nftContract = IERC721Enumerable(_nftContract);
    }

    function stake(uint256 tokenId) external nonReentrant {
        nftContract.transferFrom(msg.sender, address(this), tokenId);
        stakes[msg.sender].push(StakeInfo({tokenId: tokenId, startTime: block.timestamp}));
        tokenOwner[tokenId] = msg.sender;
    }

    function _calculateRewards(address user) internal view returns (uint256) {
        StakeInfo[] memory userStakes = stakes[user];
        uint256 total;
        for (uint256 i = 0; i < userStakes.length; i++) {
            total += (block.timestamp - userStakes[i].startTime) * rewardRate;
        }
        return total;
    }

    function claimRewards() public nonReentrant {
        uint256 reward = _calculateRewards(msg.sender) + rewards[msg.sender];
        require(reward > 0, "No rewards available");
        delete stakes[msg.sender];
        rewards[msg.sender] = 0;
        payable(msg.sender).transfer(reward);
    }

    function unstake(uint256 tokenId) external nonReentrant {
        require(tokenOwner[tokenId] == msg.sender, "Not token owner");
        uint256 index;
        StakeInfo[] storage userStakes = stakes[msg.sender];
        for (uint256 i = 0; i < userStakes.length; i++) {
            if (userStakes[i].tokenId == tokenId) {
                index = i;
                break;
            }
        }
        rewards[msg.sender] += (block.timestamp - userStakes[index].startTime) * rewardRate;
        userStakes[index] = userStakes[userStakes.length - 1];
        userStakes.pop();
        tokenOwner[tokenId] = address(0);
        nftContract.transferFrom(address(this), msg.sender, tokenId);
    }

    receive() external payable {}
}

contracts/evm/SubscriptionVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract SubscriptionVault is Ownable {
    uint256 public constant PRICE = 199 ether; // Example price
    IERC20 public immutable paymentToken;

    mapping(address => uint256) public subscribedUntil;
    mapping(address => address) public referrerOf;

    event Subscribed(address indexed user, uint256 until, address referrer);

    constructor(address token) Ownable(msg.sender) {
        paymentToken = IERC20(token);
    }

    function subscribe(address referrer) external {
        require(paymentToken.transferFrom(msg.sender, address(this), PRICE), "payment failed");
        uint256 until = block.timestamp + 30 days;
        if (subscribedUntil[msg.sender] < until) {
            subscribedUntil[msg.sender] = until;
        }
        if (referrer != address(0) && referrerOf[msg.sender] == address(0)) {
            referrerOf[msg.sender] = referrer;
        }
        emit Subscribed(msg.sender, subscribedUntil[msg.sender], referrer);
    }
}

